import React from 'react'

const PresentNews = (props) => {

    const {news} = props

    return(
        <div className="news-container wrapper">
            {news.map((n,index)=>
            <h5 key={index}>{n.author}</h5>
            )}
        </div>
    )
}

export default PresentNews;
